  {title: "47 Ronin", year: 2013, checked_out: false, reserved: false, description: "While hunting in the forest, Lord Asano of Ako and his samurai find a young half-breed and take him with them to live in the castle. Several years later, Lord Asano holds a tournament to welcome the Shogun to Ako. The night after the tournament, Lord Asano is bewitched into hurting Lord Kira of Nagato, and is punished into committing seppuku by the Shogun. Realizing that it was a Lord Kira's evil plot, the samurais and the half-breed sets out for revenge against the Shogun's order.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMTc0MjE2NzE0OV5BMl5BanBnXkFtZTgwNTU5MjE1MDE@._V1_SX300.jpg", rated: "PG-13", runtime: "128", actors: "Keanu Reeves, Hiroyuki Sanada, Ko Shibasaki, Tadanobu Asano", imdb_rating: "6.3", user_id: nil},
  {title: "300: Rise of an Empire", year: 2014, checked_out: false, reserved: false, description: "After its victory over Leonidas' 300, the Persian Army under the command of Xerxes marches towards the major Greek city-states. The Democratic city of Athens, first on the path of Xerxes' army, bases its strength on its fleet, led by admiral Themistocles. Themistocles is forced to an unwilling alliance with the traditional rival of Athens, oligarchic Sparta whose might lies with its superior infantry troops. But Xerxes still reigns supreme in numbers over sea and land.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMTEwNTU2MjAwMDdeQTJeQWpwZ15BbWU3MDk2Njc2Njk@._V1_SX300.jpg", rated: "R", runtime: "102 min", actors: "Sullivan Stapleton, Eva Green, Lena Headey, Hans Matheson", imdb_rating: "6.2", user_id: 2},
  {title: "9", year: 2009, checked_out: false, reserved: false, description: "In a world destroyed in a war between man and machine, a hand-stitched doll with the number 9 written on its back comes to life. The world he has awakened in is frightening, but he quickly learns that he is not alone and that there are others like him, also with a single digit written on their back. The first one he encounters is 2 who tells him something of what happened to the world. 2 is also thrilled with the disk 9 is carrying, one with three unique symbols on the front. 9 soon learns that the disk and some of the other dolls who are prepared to die for the good of humankind may be the last hope for man's salvation.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMTY2ODE1MTgxMV5BMl5BanBnXkFtZTcwNTM1NTM2Mg@@._V1_SX300.jpg", rated: "PG-13", runtime: "79 min", actors: "Christopher Plummer, Martin Landau, John C. Reilly, Crispin Glover", imdb_rating: "7.1", user_id: 2},
