  {title: "Aloha", year: 2015, checked_out: false, reserved: false, description: "A celebrated military contractor returns to the site of his greatest career triumphs - the US Space program in Honolulu, Hawaii - and reconnects with a long-ago love while unexpectedly falling for the hard-charging Air Force watchdog assigned to him.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMTg4Mjc0NTE1NV5BMl5BanBnXkFtZTgwNzcwNTQ3NTE@._V1_SX300.jpg", rated: "PG-13", runtime: "105 min", actors: "Bradley Cooper, Emma Stone, Rachel McAdams, Bill Murray", imdb_rating: "5.4", user_id: 2},
  {title: "50/50", year: 2011, checked_out: false, reserved: false, description: "Adam is a 27 year old writer of radio programs and is diagnosed with a rare form of spinal cancer. With the help of his best friend, his mother, and a young therapist at the cancer center, Adam learns what and who the most important things in his life are.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BNjg3ODQyNTIyN15BMl5BanBnXkFtZTcwMjUzNzM5NQ@@._V1_SX300.jpg", rated: "R", runtime: "100 min", actors: "Joseph Gordon-Levitt, Seth Rogen, Anna Kendrick, Bryce Dallas Howard", imdb_rating: "7.7", user_id: 4},
  {title: "Nacho Libre", year: 2006, checked_out: false, reserved: false, description: "Berated all his life by those around him, a monk follows his dream and dons a mask to moonlight as a Luchador (Mexican wrestler).", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMjE1OTQxNTk4NV5BMl5BanBnXkFtZTcwNDQzMjYzMQ@@._V1_SX300.jpg", rated: "PG", runtime: "92 min", actors: "Jack Black, Ana de la Reguera, Héctor Jiménez, Darius Rose", imdb_rating: "5.7", user_id: nil},
  {title: "Neighbors", year: 2014, checked_out: false, reserved: false, description: "Kelly and Mac are settling down in a quiet neighborhood with their newborn child, until the frat brothers move into the house next door. Teddy is the President, and Pete is his right hand man, and they're quick to accept friendship when Kelly and Mac introduce themselves as the neighbors. Night after night, Mac asks Teddy to lower the fraternity's noise, even accepting the invitation to the party one evening. When Teddy goes back on his word to keep the partying down, Mac calls the police to deal with the problem. The police quickly blame Mac for their presence, and the war begins. As the family feuds with the frat brothers, things get hilariously dangerous and the fraternity ends up on thin ice with their college. After receiving their final warning and being placed on probation, Mac and Kelly pull a prank so ingenious that Teddy and Pete are forced to respond.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BOTQ0OTkzODgyNF5BMl5BanBnXkFtZTgwOTA3OTE4MDE@._V1_SX300.jpg", rated: "R", runtime: "97 min", actors: "Seth Rogen, Rose Byrne, Elise Vargas, Zoey Vargas", imdb_rating: "6.4", user_id: nil},
  {title: "Anastasia", year: 1997, checked_out: false, reserved: false, description: "The daughter of the last Russian Tsar, Nicolas II, Anastasia is found by two Russian con men, Dimitri and Vladimir, who seek the reward that her grandmother, the Dowager Empress Marie, promised to the ones who'll find her. But the evil mystic of the Tsar family, Rasputin, still wants the Romanov family to be destroyed forever.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/original/gUv3j1eMDlwKXnCdEnbDozb7JvA.jpg", rated: "G", runtime: "94 min", actors: "Meg Ryan, John Cusack, Kelsey Grammer, Christopher Lloyd", imdb_rating: "7.1", user_id: nil},
  {title: "The Animatrix", year: 2003, checked_out: false, reserved: false, description: "Anthology of nine short anime (Japanese animation) films tied in to the 1999 blockbuster \\\"The Matrix\\\" and its sequels. \\\"Final Flight of the Osiris\\\": The crew of the hovercraft Osiris attempt to warn their city of an imminent attack. \\\"The Second Renaissance, Parts 1 & 2\\\": The story behind the war between man and the machines, how mankind scorched the sky, and the creation of the Matrix. \\\"Kid's Story\\\": A teenager is contacted by Neo, and manages to escape the Matrix. \\\"Program\\\": Two warriors battle in a samurai training simulation when one decides to betray his crewmates and re-enter the Matrix. \\\"World Record\\\": A champion sprinter manages to break free of the Matrix by sheer physical effort during a record attempt. \\\"Beyond\\\": A young girl searching for her cat discovers a haunted house caused by a glitch in the system. \\\"A Detective Story\\\": Private investigator Ash tracks a hacker named Trinity through the looking glass. \\\"Matriculated\\\": A group of humans capture a machine scout and insert it into a 'human matrix'.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/w325/1ISkdhJ48PDvETdxjllQ1AswTGv.jpg", rated: "PG-13", runtime: "100 min", actors: "Clayton Watson, Akio Ôtsuka, Pamela Adlon, Hedy Burress", imdb_rating: "7.4", user_id: nil},
  {title: "Annie", year: 1982, checked_out: false, reserved: false, description: "In the depths of the 1930's, Annie is a fiery young orphan girl who must live in a miserable orphanage run by the tyrannical Miss Hannigan. Her seemingly hopeless situation changes dramatically when she is selected to spend a short time at the residence of the wealthy munitions industrialist, Oliver Warbucks. Quickly, she charms the hearts of the household staff and even the seemingly cold-hearted Warbucks cannot help but learn to love this wonderful girl. He decides to help Annie find her long lost parents by offering a reward if they would come to him and prove their identity. However, Miss Hannigan, her evil brother, Rooster, and a female accomplice, plan to impersonate those people to get the reward for themselves which put Annie in great danger.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMTczMjgwNTAyNV5BMl5BanBnXkFtZTcwMDU3MzMyMQ@@._V1_SX300.jpg", rated: "PG", runtime: "127 min", actors: "Albert Finney, Carol Burnett, Ann Reinking, Tim Curry", imdb_rating: "6.5", user_id: nil},
  {title: "Ant-Man", year: 2015, checked_out: false, reserved: false, description: "Armed with the astonishing ability to shrink in scale but increase in strength, con-man Scott Lang must embrace his inner-hero and help his mentor, Dr. Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMjM2NTQ5Mzc2M15BMl5BanBnXkFtZTgwNTcxMDI2NTE@._V1_SX300.jpg", rated: "PG-13", runtime: "117 min", actors: "Paul Rudd, Michael Douglas, Evangeline Lilly, Corey Stoll", imdb_rating: "7.4", user_id: nil},
  {title: "Are You Here", year: 2013, checked_out: false, reserved: false, description: "Ben Baker is a man-child who lives on his friend's couch getting high. His friend, Steve Dallas, is a moderately successful weather reporter who is living a superficial life. When Ben receives word that his father has died, Steve drives him home and they re-connect with Ben's successful and driven sister Terri and hippie step-mother Angela who is the same age as they are. The reading of the will drives Ben to come up with a new purpose in life, but those around him don't prove to be very supportive, and then they all re-examine their own life.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BNjY3NzM2NDg0MV5BMl5BanBnXkFtZTgwOTE2MjU5MTE@._V1_SX300.jpg", rated: "R", runtime: "114 min", actors: "Owen Wilson, Jay Gates, Jason Davis, Melissa Rauch, Amy Poehler", imdb_rating: "5.3", user_id: nil},
