  {title: "Band of Brothers", year: 2001, checked_out: false, reserved: false, description: "The story of Easy Company of the US Army 101st Airborne division and their mission in WWII Europe from Operation Overlord through V-J Day.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/w325/bUrt6oeXd04ImEwQjO9oLjRguaA.jpg", rated: "TV-MA", runtime: "N/A", actors: "Scott Grimes, Damian Lewis, Ron Livingston, Shane Taylor", imdb_rating: "9.5", user_id: nil},
  {title: "Angels & Demons", year: 2009, checked_out: false, reserved: false, description: "Following the murder of a physicist, Father Silvano Bentivoglio, a symbolist, Robert Langdon, and a scientist, Vittoria Vetra, are on an adventure involving a secret brotherhood, the Illuminati. Clues lead them all around the Vatican, including the four altars of science, Earth, Air, Fire and Water. An assassin, working for the Illuminati, has captured four cardinals, and murders each, painfully. Robert and Vittoria also are searching for a new very destructive weapon that could kill millions.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMjEzNzM2MjgxMF5BMl5BanBnXkFtZTcwNTQ1MTM0Mg@@._V1_SX300.jpg", rated: "PG-13", runtime: "138 min", actors: "Tom Hanks, Ewan McGregor, Ayelet Zurer, Stellan Skarsgård", imdb_rating: "6.7", user_id: 4},
