  {title: "The Night Before", year: 2015, checked_out: false, reserved: false, description: "On Christmas eve, three lifelong friends spend the night in New York City looking for the Holy Grail of Christmas parties.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTkyNDY1ODQwNV5BMl5BanBnXkFtZTgwNzA2MjUwNzE@._V1_SX300.jpg", rated: "R", runtime: "101 min", actors: "Joseph Gordon-Levitt, Seth Rogen, Anthony Mackie, Jillian Bell", imdb_rating: "6.5", user_id: nil},
  {title: "Non-Stop", year: 2014, checked_out: false, reserved: false, description: "Bill Marks, a former cop dealing with his daughter's death by drinking, is now a federal air marshal. While on a flight from New York to London, Marks gets a text telling him that unless 150 million dollars is transferred to an offshore account, someone will die every 20 minutes. Can he find the terrorist in time and save everyone?", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BOTI3NzcxMjkzMl5BMl5BanBnXkFtZTgwMDY0NTQ0MDE@._V1_SX300.jpg", rated: "PG-13", runtime: "106 min", actors: "Liam Neeson, Julianne Moore, Scoot McNairy, Michelle Dockery", imdb_rating: "7.0", user_id: nil},
  {title: "Batman Begins", year: 2005, checked_out: false, reserved: false, description: "When his parents are killed, billionaire playboy Bruce Wayne relocates to Asia where he is mentored by Henri Ducard and Ra's Al Ghul in how to fight evil. When learning about the plan to wipe out evil in Gotham City by Ducard, Bruce prevents this plan from getting any further and heads back to his home. Back in his original surroundings, Bruce adopts the image of a bat to strike fear into the criminals and the corrupt as the icon known as 'Batman'. But it doesn't stay quiet for long.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/w325/xiosOeLfzPbfLfqui41kSWnO0sZ.jpg", rated: "PG-13", runtime: "140 min", actors: "Christian Bale, Michael Caine, Liam Neeson, Katie Holmes", imdb_rating: "8.3", user_id: nil},
  {title: "Battle Los Angeles", year: 2011, checked_out: false, reserved: false, description: "A squadron of U.S. Marines becomes the last line of defense against a global invasion.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMjA2MjQ2MzMwMV5BMl5BanBnXkFtZTcwMjIwODgzNA@@._V1_SX300.jpg", rated: "PG-13", runtime: "116 min", actors: "Aaron Eckhart, Ramon Rodriguez, Will Rothhaar, Cory Hardrict", imdb_rating: "5.8", user_id: nil},
  {title: "Big Hero 6", year: 2014, checked_out: false, reserved: false, description: "The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMDliOTIzNmUtOTllOC00NDU3LWFiNjYtMGM0NDc1YTMxNjYxXkEyXkFqcGdeQXVyNTM3NzExMDQ@._V1_SX300.jpg", rated: "PG", runtime: "102 min", actors: "Scott Adsit, Ryan Potter, Daniel Henney, T.J. Miller", imdb_rating: "7.9", user_id: nil},
  {title: "The Big Short", year: 2015, checked_out: false, reserved: false, description: "Three separate but parallel stories of the U.S mortgage housing crisis of 2005 are told. Michael Burry, an eccentric ex-physician turned one-eyed Scion Capital hedge fund manager, has traded traditional office attire for shorts, bare feet and a Supercuts haircut. He believes that the US housing market is built on a bubble that will burst within the next few years. Autonomy within the company allows Burry to do largely as he pleases, so Burry proceeds to bet against the housing market with the banks, who are more than happy to accept his proposal for something that has never happened in American history. The banks believe that Burry is a crackpot and therefore are confident in that they will win the deal. Jared Vennett with Deutschebank gets wind of what Burry is doing and, as an investor believes he too can cash in on Burry's beliefs. An errant telephone call to FrontPoint Partners gets this information into the hands of Mark Baum, an idealist who is fed up with the corruption in the financial industry. Baum and his associates, who work at an arms length under Morgan Stanley, decide to join forces with Vennett despite not totally trusting him. In addition to Burry's information, they further believe that most of the mortgages are overrated by the bond agencies, with the banks collating all the sub-prime mortgages under AAA packages. Charlie Geller and Jamie Shipley, who are minor players in a $30 million start-up garage company called Brownfield, get a hold of Vennett's prospectus on the matter. Wanting in on the action but not having the official clout to play, they decide to call an old \\\"friend\\\", retired investment banker Ben Rickert, to help out. All three of these groups work on the premise that the banks are stupid and don't know what's going on, while for them to win, the general economy has to lose, which means the suffering of the general investor who trusts the financial institutions. That latter aspect may not sit well with Baum. Some of these assumptions may be incorrect and may be far more manipulative than they could have ever imagined, which in turn may throw curves into the process.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BNDc4MThhN2EtZjMzNC00ZDJmLThiZTgtNThlY2UxZWMzNjdkXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg", rated: "R", runtime: "130 min", actors: "Ryan Gosling, Rudy Eisenzopf, Casey Groves, Charlie Talbert", imdb_rating: "7.8", user_id: nil},
  {title: "Blades of Glory", year: 2007, checked_out: false, reserved: false, description: "When rivalry between the world's best men's figure skaters - sex addicted, improvisational Chazz Michael Michaels and germophobic, precise Jimmy MacElroy - breaks into a fight on the awards platform, they're banned from the event for life. Three years later, desire for a gold medal and a careful reading of the rules lead them to compete as skating's first male-male pair. Can they overcome mutual dislike, limited time to prepare, their coach's secret past, and the dirty tricks of their main opponents, the Van Waldenberg siblings? The key to victory or defeat may lie in the attraction of the virginal Jimmy toward Katie, the Van Waldenbergs' little sister.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMTY3MDMyMTYxMl5BMl5BanBnXkFtZTcwMjk0NzI0MQ@@._V1_SX300.jpg", rated: "PG-13", runtime: "93 min", actors: "Will Ferrell, Jon Heder, Will Arnett, Amy Poehler", imdb_rating: "6.3", user_id: nil},
  {title: "The Bourne Identity", year: 2002, checked_out: false, reserved: false, description: "Based very loosely on Robert Ludlum's novel, the Bourne Identity is the story of a man whose wounded body is discovered by fishermen who nurse him back to health. He can remember nothing and begins to try to rebuild his memory based on clues such as a Swiss bank account, the number of which is implanted in his hip. He soon realizes that he is being hunted and takes off with Marie on a search to find out who he is - and why he is being hunted.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BNDRmOGQ0ZjktMTQ5Zi00NTZlLTk5MjktOWY4ZjcyOGE5OGRlXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg", rated: "PG-13", runtime: "119 min", actors: "Matt Damon, Franka Potente, Chris Cooper, Clive Owen", imdb_rating: "7.9", user_id: nil},
  {title: "The Bourne Supremacy", year: 2004, checked_out: false, reserved: false, description: "When Jason Bourne is framed for a CIA operation gone awry, he is forced to resume his former life as a trained assassin to survive.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/w325/6a74OaZArLNNDHK9SdiLBUu2JYj.jpg", rated: "PG-13", runtime: "108 min", actors: "Matt Damon, Franka Potente, Brian Cox, Julia Stiles", imdb_rating: "7.8", user_id: nil},
