  {title: "3:10 to Yuma", year: 2007, checked_out: false, reserved: true, description: "Rancher Dan Evans heads into Bisbee to clear up issues concerning the sale of his land when he witnesses the closing events of a stagecoach robbery led by famed outlaw Ben Wade. Shortly thereafter, Wade is captured by the law in Bisbee and Evans finds himself one of the escorts who will take Wade to the 3:10 to Yuma train in Contention for the reward of $200. Evans's effort to take Wade to the station is in part an effort to save his land but also part of an inner battle to determine whether he can be more than just a naive rancher in the eyes of his impetuous and gunslinging son William Evans. The transport to Contention is hazardous and filled with ambushes by Indians, pursuits by Wade's vengeful gang and Wade's own conniving and surreptitious demeanor that makes the ride all the more intense.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/original/9Nwkh0eQmkymEOR0ovAALtjSIZW.jpg", rated: "R", runtime: "122 min", actors: "Russell Crowe, Christian Bale, Logan Lerman, Dallas Roberts", imdb_rating: "7.7", user_id: nil},
  {title: "Constantine", year: 2005, checked_out: false, reserved: true, description: "John Constantine is approached by Det. Angela Dodson who needs his help to prove that her twin sister Isabel's death was not a suicide. The dead woman was a devout Catholic and Angela refuses to accept she would have taken her own life. She's asked Constantine for help because he has a reputation for dealing with the mystical. In fact, he is a demon hunter whose sole purpose on Earth is to send demons back to the nether regions. John himself has been to Hell and knows that he is destined to return there on his death - but hopes his good deeds may find him a place in Heaven. As he looks into Isabel's death, he realizes demons are trying to break through to the human world, and his battles lead him into a direct conflict with Satan.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/original/qYTerimWp1t1zSEKknn9mByhwbX.jpg", rated: "R", runtime: "121 min", actors: "Keanu Reeves, Rachel Weisz, Shia LaBeouf, Djimon Hounsou", imdb_rating: "6.9", user_id: 2},
