  {title: "The Hunger Games: Catching Fire", year: 2013, checked_out: false, reserved: false, description: "Twelve months after winning the 74th Hunger Games, Katniss Everdeen and her partner Peeta Mellark must go on what is known as the Victor's Tour, wherein they visit all the districts, but before leaving, Katniss is visited by President Snow who fears that Katniss defied him a year ago during the games when she chose to die with Peeta. With both Katniss and Peeta declared the winners, it is fueling a possible uprising. He tells Katniss that while on tour she better try to make sure that she puts out the flames or else everyone she cares about will be in danger.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTAyMjQ3OTAxMzNeQTJeQWpwZ15BbWU4MDU0NzA1MzAx._V1_SX300.jpg", rated: "PG-13", runtime: "146 min", actors: "Jennifer Lawrence, Liam Hemsworth, Jack Quaid, Taylor St. Clair", imdb_rating: "7.6", user_id: nil},
  {title: "I Am Legend", year: 2007, checked_out: false, reserved: false, description: "Robert Neville is a scientist who was unable to stop the spread of the terrible virus that was incurable and man-made. Immune, Neville is now the last human survivor in what is left of New York City and perhaps the world. For three years, Neville has faithfully sent out daily radio messages, desperate to find any other survivors who might be out there. But he is not alone. Mutant victims of the plague -- The Infected -- lurk in the shadows... watching Neville's every move... waiting for him to make a fatal mistake. Perhaps mankind's last, best hope, Neville is driven by only one remaining mission: to find a way to reverse the effects of the virus using his own immune blood. But he knows he is outnumbered... and quickly running out of time.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTU4NzMyNDk1OV5BMl5BanBnXkFtZTcwOTEwMzU1MQ@@._V1_SX300.jpg", rated: "PG-13", runtime: "101 min", actors: "Will Smith, Alice Braga, Charlie Tahan, Salli Richardson-Whitfield", imdb_rating: "7.2", user_id: nil},
