  {title: "Kingsman: The Secret Service", year: 2014, checked_out: false, reserved: false, description: "A young man named Eggsy whose father died when he was a young boy, is dealing with living with the creep her mother is with now, who mistreats her and him. He goes out and does something to one of the creep's friends. He gets arrested and he calls a number a man gave him around the time his father died, to call if he needs help. A man named Harry approaches him and tells him he's the one who helped him. He tells him that he knew his father. When the man Eggsy slighted wants some payback, Harry takes care of him and his companions single handed. Harry then tells Eggsy that he's part of a secret organization called the Kingsman and his father was also part of it. He died trying to make the world safe. Harry offers Eggsy the opportunity to be a Kingsman and he takes it. He undergoes a grueling training course. Harry is looking into the demise of another Kingsman and the trail leads him to tech billionaire named Valentine who is also curious about the group following him, the Kingsman.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTkxMjgwMDM4Ml5BMl5BanBnXkFtZTgwMTk3NTIwNDE@._V1_SX300.jpg", rated: "R", runtime: "129 min", actors: "Adrian Quinton, Colin Firth, Mark Strong, Jonno Davies", imdb_rating: "7.8", user_id: nil},
