  {title: "Maleficent", year: 2014, checked_out: false, reserved: false, description: "A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land. Maleficent rises to be the land's fiercest protector, but she ultimately suffers a ruthless betrayal - an act that begins to turn her pure heart to stone. Bent on revenge, Maleficent faces a battle with the invading king's successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom - and perhaps to Maleficent's true happiness as well.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMjAwMzAzMzExOF5BMl5BanBnXkFtZTgwOTcwMDA5MTE@._V1_SX300.jpg", rated: "PG", runtime: "97 min", actors: "Angelina Jolie, Elle Fanning, Sharlto Copley, Lesley Manville", imdb_rating: "7.0", user_id: nil},
  {title: "The Man from U.N.C.L.E.", year: 2015, checked_out: false, reserved: false, description: "In the 1960s with the Cold War in play, CIA agent Napoleon Solo successfully helps Gaby Teller defect to West Germany despite the intimidating opposition of KGB agent Illya Kuryakin. Later, all three unexpectedly find themselves working together in a joint mission to stop a private criminal organization from using Gaby's father's scientific expertise to construct their own nuclear bomb. Through clenched teeth and stylish poise, all three must find a way to cooperate for the sake of world peace, even as they each pursue their own agendas.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTc2NjQ4ODYyNF5BMl5BanBnXkFtZTgwODA3OTU5NTE@._V1_SX300.jpg", rated: "PG-13", runtime: "116 min", actors: "Henry Cavill, Armie Hammer, Alicia Vikander, Elizabeth Debicki", imdb_rating: "7.3", user_id: nil},
  {title: "Mad Max: Fury Road", year: 2015, checked_out: false, reserved: true, description: "An apocalyptic story set in the furthest reaches of our planet, in a stark desert landscape where humanity is broken, and almost everyone is crazed fighting for the necessities of life. Within this world exist two rebels on the run who just might be able to restore order. There's Max, a man of action and a man of few words, who seeks peace of mind following the loss of his wife and child in the aftermath of the chaos. And Furiosa, a woman of action and a woman who believes her path to survival may be achieved if she can make it across the desert back to her childhood homeland.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTUyMTE0ODcxNF5BMl5BanBnXkFtZTgwODE4NDQzNTE@._V1_SX300.jpg", rated: "R", runtime: "120 min", actors: "Tom Hardy, Charlize Theron, Nicholas Hoult, Hugh Keays-Byrne", imdb_rating: "8.1", user_id: 2},
