  {title: "Paris, je t'aime", year: 2006, checked_out: false, reserved: false, description: "Paris, je t'aime is about the plurality of cinema in one mythic location: Paris, the City of Love. Twenty filmmakers have five minutes each; the audience must weave a single narrative out of twenty moments. The 20 moments are fused by transitional interstitial sequences and also via the introduction and epilogue. Each transition begins with the last shot of the previous film and ends with the first shot of the following film, extending the enchantment and the emotion of the previous segment, preparing the audience for a surprise, and providing a cohesive atmosphere. There's a reappearing mysterious character who is a witness to the Parisian life. A common theme of Paris and love fuses all.", times_rented: nil, img_url: "http://ia.media-imdb.com/images/M/MV5BMTc1MDgwNDE4MF5BMl5BanBnXkFtZTcwMTQzMzc0MQ@@._V1_SX300.jpg", rated: "R", runtime: "120 min", actors: "Fanny Ardant, Julie Bataille, Leïla Bekhti, Melchior Derouet", imdb_rating: "7.3", user_id: nil},
