  {title: "Prometheus", year: 2012, checked_out: false, reserved: false, description: "This film is set in 2093 and takes place in the same universe as the 'Alien' movies. A group of explorers, including some archaeologists, are on an \"undisclosed\" mission. They arrive at a moon trillions of miles away from Earth. The team spot what they believe to be signs of civilization. They go to investigate and find more than just signs, they find conclusive evidence. But some of them have an ulterior motive for being there, including the Weyland Corporation. They believe that this is where the human race actually came from. Things soon turn from excitement to survival once inside their discovery.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTY3NzIyNTA2NV5BMl5BanBnXkFtZTcwNzE2NjI4Nw@@._V1_SX300.jpg", rated: "R", runtime: "124 min", actors: "Noomi Rapace, Michael Fassbender, Charlize Theron, Idris Elba", imdb_rating: "7.0", user_id: nil},
