  {title: "Rango", year: 2011, checked_out: false, reserved: false, description: "Rango is a pet chameleon always on the lookout for action and adventure, except the fake kind, where he directs it and acts in it. After a car accident, he winds up in an old western town called Dirt. What this town needs the most is water, but they also need a hero and a sheriff. The thirsty Rango instantly takes on the role of both and selfishly agrees to take on the case of their missing water.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMjE5ODg1NTk3OF5BMl5BanBnXkFtZTcwNzA5NTMyNA@@._V1_SX300.jpg", rated: "PG", runtime: "107 min", actors: "Johnny Depp, Isla Fisher, Abigail Breslin, Ned Beatty", imdb_rating: "7.2", user_id: nil},
  {title: "Red Dawn", year: 1984, checked_out: false, reserved: false, description: "From out of the sky, Soviet, Nicaraguan, and Cuban troops begin landing on the football field of a Colorado high school. In seconds, the paratroopers have attacked the school and sent a group of teenagers fleeing into the mountains. Armed only with hunting rifles, pistols, and bows and arrows, the teens struggle to survive the bitter winter and the Soviet KGB patrols hunting for them. Eventually, trouble arises when they kill a group of Soviet soldiers on patrol in the highlands. Soon they will wage their own guerrilla warfare against the invading Soviet troops-under the banner of 'Wolverines!'", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BNzgzNjcwMjI3MF5BMl5BanBnXkFtZTcwNDAxNTQyNA@@._V1_SX300.jpg", rated: "PG-13", runtime: "114 min", actors: "Patrick Swayze, C. Thomas Howell, Lea Thompson, Charlie Sheen", imdb_rating: "6.4", user_id: nil},
  {title: "Remember the Titans", year: 2000, checked_out: false, reserved: false, description: "Suburban Virginia schools have been segregated for generations. One Black and one White high school are closed and the students sent to T.C. Williams High School under federal mandate to integrate. The year is seen through the eyes of the football team where the man hired to coach the Black school is made head coach over the highly successful white coach. Based on the actual events of 1971, the team becomes the unifying symbol for the community as the boys and the adults learn to depend on and trust each other.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTczNTA2MDc0OF5BMl5BanBnXkFtZTYwMTg4MDY2._V1_SX300.jpg", rated: "PG", runtime: "113 min", actors: "Denzel Washington, Will Patton, Wood Harris, Ryan Hurst", imdb_rating: "7.8", user_id: nil},
  {title: "The Rescuers", year: 1977, checked_out: false, reserved: false, description: "When a bottle containing a plea for help from a little girl named Penny makes its way to the Rescue Aid Society, a mouse organization in the basement of the United Nations building dedicated to the rescue and well-being of anyone in need, it is up to the brave mouse Miss Bianca and her chosen partner, the shy janitor Bernard, to rescue the girl. Searching for clues at Penny's home at Morningside Orphanage in New York City, the two mice discover that the girl has been kidnapped by the evil pawn shop owner Madame Medusa and her companion Mr. Snoops. On the back of Orville the albatross, Miss Bianca and Bernard travel to the terrifyingly gloomy Devil's Bayou where they learn the shocking truth: the innocent young girl is being forced down into a dangerous, dark underground pirate's cave where she must find the Devil's Eye, the world's largest diamond and Madame Medusa's greatest obsession. Before returning safely home, Miss Bianca, Bernard, and Penny will have to combat Madame Medusa's two ferocious pet alligators Brutus and Nero with the help of Ellie Mae and Evinrude the dragonfly, as well as survive the raging tides inside the horrible pirate's cave.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMjE0OTE1MjQzM15BMl5BanBnXkFtZTYwNzYyNzk5._V1_SX300.jpg", rated: "G", runtime: "78 min", actors: "Bob Newhart, Eva Gabor, Geraldine Page, Joe Flynn", imdb_rating: "6.9", user_id: nil},
  {title: "The Rescuers Down Under", year: 1990, checked_out: false, reserved: false, description: "Cody, a boy from Mugwomp Flats responds to a distress call about a trapped giant Golden Eagle called Marahute. Freeing her, he gains a close friendship with the bird. However, Cody is soon abducted by the murderous poacher, Percival McLeach, who is after that bird which is of a highly endangered species and therefore an extremely profitable quarry. In a panic, a mouse Cody freed from one of McLeach's traps sends a desperate call for help to the Rescue Aid Society in New York City who assigns their top agents, Miss Bianca and Bernard, to the task. With transportation provided by the goofy albatross, Wilbur, the agents arrive in Australia and link up with the RAS' local field operative, Jake the Kangaroo Rat. Together, the trio must race against time to find Cody, stop McLeach, and save Marahute.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTIwNDk4NDA4Ml5BMl5BanBnXkFtZTYwODg4ODk4._V1_SX300.jpg", rated: "G", runtime: "77 min", actors: "Bob Newhart, Eva Gabor, John Candy, Tristan Rogers", imdb_rating: "6.9", user_id: nil},
