  {title: "Romeo + Juliet", year: 1996, checked_out: false, reserved: false, description: "The classic story of Romeo and Juliet, set in a modern-day city of Verona Beach. The Montagues and Capulets are two feuding families, whose children meet and fall in love. They have to hide their love from the world because they know that their parents will not allow them to be together. There are obstacles on the way, like Juliet's cousin, Tybalt, and Romeo's friend Mercutio, and many fights. But although it is set in modern times, it is still the same timeless story of the \"star crossed lovers\".", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTI2ODc3NDI4OV5BMl5BanBnXkFtZTYwMTY1MjQ5._V1._CR1,1,341,448_SY132_CR5,0,89,132_AL_.jpg_V1_SX300.jpg", rated: "PG-13", runtime: "120 min", actors: "Leonardo DiCaprio, Claire Danes, John Leguizamo, Harold Perrineau", imdb_rating: "6.8", user_id: nil},
