  {title: "Sweeney Todd: The Demon Barber of Fleet Street", year: 2007, checked_out: false, reserved: false, description: "In the Victorian London, the barber Benjamin Barker is married to the gorgeous Lucy and they have a lovely child, Johanna. The beauty of Lucy attracts the attention of the corrupt Judge Turpin, who falsely accuses the barber of a crime that he did not commit and abuses Lucy later after gaining custody of her. After fifteen years in exile, Benjamin returns to London under the new identity of Sweeney Todd, seeking revenge against Turpin. He meets the widow Mrs. Lovett who is the owner of a meat pie shop who tells him that Lucy swallowed arsenic many years ago, and Turpin assigned himself tutor of Johanna. He opens a barber shop above her store, initiating a crime rampage against those who made him suffer and lose his beloved family.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTg3NjUxMzM5NV5BMl5BanBnXkFtZTcwMzQ1NjQzMw@@._V1_SX300.jpg", rated: "R", runtime: "116 min", actors: "Johnny Depp, Helena Bonham Carter, Alan Rickman, Timothy Spall", imdb_rating: "7.4", user_id: nil},
  {title: "Taken", year: 2008, checked_out: false, reserved: false, description: "Seventeen year-old Kim is the pride and joy of her father Bryan Mills. Bryan is a retired agent who left the Central Intelligence Agency to be near Kim in California. Kim lives with her mother Lenore and her wealthy stepfather Stuart. Kim manages to convince her reluctant father to allow her to travel to Paris with her friend Amanda. When the girls arrive in Paris they share a cab with a stranger named Peter, and Amanda lets it slip that they are alone in Paris. Using this information an Albanian gang of human traffickers kidnaps the girls. Kim barely has time to call her father and give him information. Her father gets to speak briefly to one of the kidnappers and he promises to kill the kidnappers if they do not let his daughter go free. The kidnapper wishes him \"good luck\", so Bryan Mills travels to Paris to search for his daughter and her friend.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BMTM4NzQ0OTYyOF5BMl5BanBnXkFtZTcwMDkyNjQyMg@@._V1_SX300.jpg", rated: "PG-13", runtime: "93 min", actors: "Liam Neeson, Maggie Grace, Leland Orser, Jon Gries", imdb_rating: "7.8", user_id: nil},
