  {title: "The Book of Eli", year: 2010, checked_out: false, reserved: false, description: "In a violent post-apocalyptic society, a drifter, Eli, has been wandering westward across North America for the last thirty years. He finds solace in a unique book which he carries on his person and guards closely, whilst surviving by hunting small animals and seeking goods in destroyed houses and vehicles to trade in villages for water and supplies. When he reaches a village ruled by the powerful mobster, Carnegie, the man views Eli's impressive fighting skills and offers Eli a place within his gang. Carnegie presses his blind lover Claudia to send her daughter, Solara, to at least convince Eli to spend the night by sleeping with him. However, Eli proves to be the better man when he gently declines her advances. The girl sees Eli's book, and when Carnegie finds out he beats her mother until she reveals what she saw. Carnegie sends his gang into the wasteland to take the book from Eli, but the man proves to be a formidable foe as he makes it more than clear that if they want the book, they must first take his life.", times_rented: nil, img_url: "https://images-na.ssl-images-amazon.com/images/M/MV5BNTE1OWI1YzgtZjEyMy00MjQ4LWE0NWMtYTNhYjc0ZDQ3ZGRkXkEyXkFqcGdeQXVyNDQ2MTMzODA@._V1_SX300.jpg", rated: "R", runtime: "118 min", actors: "Denzel Washington, Gary Oldman, Mila Kunis, Ray Stevenson", imdb_rating: "6.9", user_id: nil},
  {title: "Vietnam: 50 Years Remembered\"", year: 2015, checked_out: false, reserved: false, description: "In 1965, the United States officially became involved in the conflict in Southeast Asia where decades of turmoil had been building since the beginning of World War II. The fall of French Indochina and the spread of Communism, catapulted the country into one of its longest and deadliest wars. The history of U.S. involvement is told in this 7 part documentary series featuring personal stories from veterans and detailing the battles, strategy, and politics of a war that consumed multiple U.S. Presidents. VIETNAM: 50 YEARS REMEMBERED is a chronicle of the tragedy that tested the strength of our country and forever changed the social and political landscape of the world.", times_rented: nil, img_url: "https://image.tmdb.org/t/p/original/mSRyeSsDKEzbWBEnttExiyHshIx.jpg", rated: "N/A", runtime: "360 min", actors: "Coby Batty", imdb_rating: "N/A", user_id: nil},
